    render() {
        const { selectedTags } = this.state;
        return (
            <>
                <div>
                    <Layout className="mainLayout">
                        {/* Header */}
                        <Header className="mainHeader">
                            <Row justify="space-between">
                                <Col>
                                    <Image
                                        preview={false}
                                        width={100}
                                        src="data:image/png;base64,"
                                    />
                                </Col>
                                <Col>
                                    Hi, User <Avatar size="small">U</Avatar>
                                </Col>
                            </Row>
                        </Header>

                        {/* Content */}
                        <Content className="mainContent">
                            <Row>
                                <Col span={24}>
                                    <Row justify="space-between">
                                        <Col>
                                            <h3>My Learning</h3>
                                        </Col>
                                        <Col>
                                            <Space>
                                                <Input className="searchBox" placeholder="Masukkan kata kunci" suffix={<SearchOutlined />} allowClear />
                                                <Button className="searchButton" type="primary">Search Class</Button>
                                            </Space>
                                        </Col>
                                    </Row>
                                    <Divider />
                                    <Row>
                                        <div className="buttonFilter">
                                            {tagsData.map(tag => (
                                                <CheckableTag
                                                    key={tag}
                                                    checked={selectedTags.indexOf(tag) > -1}
                                                    onChange={checked => this.handleChange(tag, checked)}
                                                >
                                                    {tag}
                                                </CheckableTag>
                                            ))}
                                        </div>
                                    </Row>
                                    <Row>
                                        <List style={{ width: "100%" }}
                                            itemLayout="horizontal"
                                            dataSource={dataList}
                                            renderItem={(item) => (
                                                <List.Item>
                                                    <Card className="cardContainer">
                                                        <Row gutter={[20, 0]}>
                                                            <Col span={4}>
                                                                <Image className="imagePreview"
                                                                    preview={false}
                                                                    src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png" />
                                                            </Col>
                                                            <Col span={20}>
                                                                <Row justify="space-between">
                                                                    <Col>
                                                                        <Space>
                                                                            <Tag className="classTypeTag" style={{ backgroundColor: this.typeTagColor(item.worktype), color: this.typeTextColor(item.worktype) }}>{item.worktype}</Tag>
                                                                            {item.title}
                                                                        </Space>
                                                                    </Col>
                                                                    <Col>
                                                                        <TeamOutlined /> {item.participant} participant
                                                                    </Col>
                                                                </Row>
                                                                <Divider />
                                                                <Row justify="space-between">
                                                                    <Col>
                                                                        <Row gutter={10}>
                                                                            <Col>
                                                                                Applied On
                                                                                <br />
                                                                                Posted On
                                                                                <br />
                                                                                Will Start On
                                                                                <br />
                                                                                Access Link
                                                                            </Col>
                                                                            <Col>
                                                                                :
                                                                                <br />
                                                                                :
                                                                                <br />
                                                                                :
                                                                                <br />
                                                                                :
                                                                            </Col>
                                                                            <Col>
                                                                                {item.applied}
                                                                                <br />
                                                                                {item.posted}
                                                                                <br />
                                                                                {item.starton}
                                                                                <br />
                                                                                {item.acclink}
                                                                            </Col>
                                                                        </Row>
                                                                    </Col>
                                                                    <Col>
                                                                        <Button>{item.status}</Button>
                                                                    </Col>
                                                                </Row>
                                                            </Col>
                                                        </Row>
                                                    </Card>
                                                </List.Item>
                                            )}
                                        />
                                    </Row>
                                </Col>
                            </Row>
                        </Content>
                    </Layout>
                </div>
            </>
        );
    }
}

export default MyLearning;
